import React from 'react';
import './App.css';
import Toolbar from './components/Toolbar';
import Portfolio from './components/Portfolio';

const App = props => (
    <div>
        <Toolbar
            filters={props.filters}
            selected={'All'}
            onSelectFilter={(filter) => console.log(filter)} />
        <Portfolio projects={props.projects} />
    </div>
);

export default App;
